    measurementId: "G-82141WYBBL"
};


const authConfig = {
    userProfilePath: '/users/',
    userAdminProp: 'isAdmin'
};


const App = () => (
    <Admin  dashboard={Dashboard}  authProvider={authProvider} dataProvider={dataProvider}>
